customDir + \" was created\");\r\n} else {\r\n    System.out.println(customDir + \" was not created\");\r\n}',NULL,'javatxt.txt'),(4,_binary 'String path = System.getProperty(\"user.home\") + File.separator + \"Documents\";\r\npath += File.separator + \"Your Custom Folder\"\r\nFile customDir = new File(path);\r\n\r\nif (customDir.exists()) {\r\n    System.out.println(customDir + \" already exists\");\r\n} else if (customDir.mkdirs()) {\r\n    System.out.println(customDir + \" was created\");\r\n} else {\r\n    System.out.println(customDir + \" was not created\");\r\n}',NULL,'notespdf.txt'),(5,_binary '\r\nMembers of Governing Body of the University\r\n\r\n Name of Members				Designation 		\r\n\r\n1.	Prof. Dr. Vishwanath D. Karad		President		\r\n\r\n2.	Prof. Dr. Mangesh T. Karad		Executive President\r\n\r\n3.	Dr. Sunil K Rai				Vice-Chancellor\r\n\r\n4.	Dr. Suresh G. Ghaisas			Member\r\n\r\n5.	Prof. Prakash B. Joshi			Member\r\n\r\n6.	Dr. Chandrakant S. Pandav		Member\r\n\r\n7.	Prof. Rahul V. Karad			Member\r\n\r\n8.	Dr. Anand Deshpande			Member\r\n\r\n9.	Dr. Arvind Sitaraman			Member\r\n\r\n10.	Mr. S.R.Phophale 			Member\r\n\r\n11.	Mr. Shivsharan Mali        		Member Secreatary, Registrar\r\n',NULL,'1.txt'),(6,_binary '\r\nMembers of Governing Body of the University\r\n\r\n Name of Members				Designation 		\r\n\r\n1.	Prof. Dr. Vishwanath D. Karad		President		\r\n\r\n2.	Prof. Dr. Mangesh T. Karad		Executive President\r\n\r\n3.	Dr. Sunil K Rai				Vice-Chancellor\r\n\r\n4.	Dr. Suresh G. Ghaisas			Member\r\n\r\n5.	Prof. Prakash B. Joshi			Member\r\n\r\n6.	Dr. Chandrakant S. Pandav		Member\r\n\r\n7.	Prof. Rahul V. Karad			Member\r\n\r\n8.	Dr. Anand Deshpande			Member\r\n\r\n9.	Dr. Arvind Sitaraman			Member\r\n\r\n10.	Mr. S.R.Phophale 			Member\r\n\r\n11.	Mr. Shivsharan Mali        		Member Secreatary, Registrar\r\n',NULL,'1.txt'),(7,_binary 'JCXZ (Jump if ECX Zero) branches to the label specified in the instruction\r\nif it finds a value of zero in ECX. JCXZ is useful in combination with the\r\nLOOP instruction and with the string scan and compare instructions, all of\r\nwhich decrement ECX. Sometimes, it is desirable to design a loop that\r\nexecutes zero times if the count variable in ECX is initialized to zero.\r\nBecause the LOOP instructions (and repeat prefixes) decrement ECX before\r\nthey test it, a loop will execute 232 times if the program enters the\r\nloop with a zero value in ECX. A programmer may conveniently overcome this\r\nproblem with JCXZ, which enables the program to branch around the code\r\nwithin the loop if ECX is zero when JCXZ executes. When used with repeated\r\nstring scan and compare instructions, JCXZ can determine whether the\r\nrepetitions terminated due to zero in ECX or due to satisfaction of the\r\nscan or compare conditions.',NULL,'2.txt'),(8,_binary '$$#include<iostream>\r\nusing namespace std;\r\nclass abc { \r\n   public: \r\n      static int x; \r\n      int i; \r\n\r\n      abc() {\r\n         i = ++x;\r\n      }\r\n   };\r\nint abc::x;\r\n\r\nmain() { \r\n   abc m, n, p;\r\n   \r\n   cout<<m.x<<\" \"<<m.i<<endl;\r\n}$$\r\n\r\n#3 1#\r\n#3 3#\r\n#1 1#\r\n#1 3#\r\n\r\n#3 1#\r\n\r\n$$#include<iostream>\r\n\r\nusing namespace std;\r\nmain() {\r\n   short unsigned int i = 0; \r\n   \r\n   cout<<i--;\r\n}$$\r\n\r\n#0#\r\n#Compile error#\r\n#65535#\r\n#32767#\r\n\r\n#32767#\r\n\r\n$$i)single file can be opened by several streams simultaneously.\r\nii)several files simultaneously can be opened by a single stream.$$\r\n#(i) and (ii) are true#\r\n# (i) and (ii) are false#\r\n#Only (i) is true#\r\n#Only (ii) is true#\r\n\r\n#(i) and (ii) are true#\r\n\r\n',NULL,'javatxt.txt'),(9,_binary '%PDF-1.5\n%µ\í®û\n3 0 obj\n<< /Length 4 0 R\n   /Filter /FlateDecode\n>>\nstream\nxœ\Õ[K¹¾\ëWô.«ø9	\ÈÁ‰o‹lÙ³‹…„À\É!ùùùŠÏ–º¥‘4=¶³F\ï4kšõ\"Yõ\ÉùºÓ“üûÛŸ§Ÿ>\ê\é\×\ï´r\Ş\Ç\é?ø\Å_ğü¾ûerJ(¬\Øş>ş¼#=ıuú:Q\îû$?Bd˜­Ÿö\Ç]pŠ4O\Öe\\šS%\ãUò4&ò¤\âœğ÷\éı\î0W\Âş«ğ|\Âû\é\Ä|º\Ğ\à)\å>t°\Ğ\á)XÉƒä‚²\ÚC\èS •¢_=¶\ï¼